import React from 'react';

import { Box, Flex } from '../../atoms/layout';
import { Paragraph } from '../../atoms/typography';

export const FileItem: React.FC = () => (
	<Flex>
		<Box>
			<Paragraph></Paragraph>
		</Box>
		{isOpen ? <img src="/assets/expand-more-white.svg" />
		: <img src="/assets/expand-less-white.svg" />}
	</Flex>
);
